export class CodeView implements VirtualDOM<'div'> {
    /**
     * Component's class name for CSS query.
     */
    static readonly CssSelector = 'mkdocs-CodeView'
    public readonly router: Router
    public readonly code: Code
    public readonly configuration: Configuration
    public readonly project: Project

    public readonly tag = 'div'
    public readonly class = `${CodeView.CssSelector} fv-border-primary rounded`
    public readonly style = {
        fontSize: '0.9em',
    }
    public readonly children: ChildrenLike
    public readonly expanded$ = new BehaviorSubject(false)
    constructor(params: {
        code: Code
        parent: Entity
        router: Router
        configuration: Configuration
        project: Project
    }) {
        Object.assign(this, params)
        const declarationView = new DeclarationView({
            code: this.code,
            parent: params.parent,
        })
        if (this.code.implementation === undefined) {
            this.children = [declarationView]
            return
        }
        const implementation = this.code.implementation
        this.children = [
            declarationView,
            { tag: 'div', class: 'my-1' },
            new CodeHeaderView({
                code: this.code,
                parent: params.parent,
                expanded$: this.expanded$,
                configuration: this.configuration,
                project: this.project,
            }),
            child$({
                source$: this.expanded$,
                vdomMap: (expanded) => {
                    if (!expanded) {
                        return { tag: 'div' }
                    }
                    return {
                        tag: 'div',
                        class: 'ms-1 me-1 mt-1 code-api-snippet ',
                        style: {
                            fontSize: '0.8em',
                        },
                        children: [
                            parseMd({
                                src: `
<code-snippet language="javascript">
${implementation}
</code-snippet>`,
                                router: this.router,
                            }),
                        ],
                    }
                },
            }),
        ]
    }
}

export class DeclarationView implements VirtualDOM<'div'> {
    /**
     * Component's class name for CSS query.
     */
    static readonly CssSelector = 'mkdocs-DeclarationView'
    public readonly tag = 'div'
    public readonly children: ChildrenLike
    public readonly class = `${DeclarationView.CssSelector} mkapi-declaration mkapi-semantic-color p-2 rounded`
    constructor({
        code,
        parent,
    }: {
        code: Pick<Code, 'references' | 'declaration'>
        parent: Pick<Entity, 'semantic'>
    }) {
        this.class += ` mkapi-role-${parent.semantic.role}`
        const nonNullReferences = Object.entries(code.references).reduce(
            (acc, [k, v]) => {
                if (!v) {
                    return acc
                }
                return { ...acc, [k]: v }
            },
            {},
        )
        const declaration = processDeclaration(
            code.declaration,
            nonNullReferences,
            (k: string, v: string) => `<a target='_blank' href='${v}'>${k}</a>`,
        )

        this.children = [
            {
                tag: 'pre',
                class: 'py-0 my-0',
                innerHTML: declaration,
            },
        ]
    }
}

