export function codeApiEntryNode<TLayout, THeader>(
    params: {
        name: string
        header: DefaultLayout.NavHeader
        docBasePath: string
        entryModule: string
        configuration: Configuration<TLayout, THeader>
        httpClient?: ({
            project,
            configuration,
        }: {
            project: Project
            configuration: Configuration<TLayout, THeader>
        }) => HttpClientTrait
    },
    ctx?: ContextTrait,
): Navigation<TLayout, THeader> {
    const project = {
        name: params.entryModule,
        docBasePath: params.docBasePath,
    }
    const configuration = params.configuration
    const httpClient =
        params.httpClient?.({ configuration, project }) ??
        new HttpClient({
            project,
            configuration,
        })
    return {
        ...configuration.navNode({
            name: params.name,
            header: params.header,
            layout: {
                toc,
                content: ({ router }: { router: Router }) => {
                    return moduleView(
                        {
                            path: project.name,
                            router,
                            configuration,
                            project,
                            httpClient,
                        },
                        ctx,
                    )
                },
            },
        }),
        routes: ({ router, path }: { router: Router; path: string }) =>
            docNavigation(
                {
                    modulePath: path,
                    router,
                    project,
                    configuration,
                    httpClient,
                },
                ctx,
            ),
    }
}
